description:
Video game developer Clayton Software enlists a misfit group of programmers to develop the scariest computer combat game ever. They use a telemetry suit to render a 3-D version of the on-screen player -- but when a power surge gives the hard drive a mind of its own, the suit comes to life to play the game for real and draws the programmers into a chilling virtual nightmare.
